    the $200 aggregate.These unitemized contributions represent small ($.05 and $.10)
    hourly contributions made by individual union members. While a small number of
    our members (approximately 1%) do reach the aggregate $200 amount requiring itemization
    each year, none do so this early. Virtually all members reaching the $200 aggregate
    do so in the fourth quarter of the calendar year. *********** NOTE: ADDITIONAL
