    PAC at a 2:1 ratio: one-third of member contributions went into a non-federal
    account and two-thirds went into the federal account. Our former analyst did not
    suggest to us that we should be operating in any other way. When we were re-assigned
    to our current analyst, she made it clear that it would be best if all contributions
    came in through the federal PAC and then funds needed for non-federal activity
